import React from 'react';
import Card from './Card';

const Cardlist = (props) => {
	return(
		<div>
			<Card id={props.robots[0].id} name={props.robots[0].name}  email={props.robots[0].email}/>
			<Card id={props.robots[1].id} name={props.robots[1].name} username={props.robots[1].username} email={props.robots[1].email}/>
			<Card id={props.robots[2].id} name={props.robots[2].name} username={props.robots[2].username} email={props.robots[2].email}/>
		</div>
	);
}

export default Cardlist;
